content:
@ACEurasia @UmlandAndreas @AmbDanFried @JohnEdHerbst @ARVershbow Full #embargo on Russia’s oil&amp;gas, and switching it off the #SWIFT is the only real non-military way to deter Russia

It had to be done in 2014, right after Russia annexed Crimea and shot down #MH17 aircraft

Nothing else will help. Another option - Ukraine’s membership in NATO.

